import { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

function DetailPage(props) {
  let { id } = useParams();
  useEffect(() => {
    axios.get(`/api/board/detail/${id}`).then((res) => {
      props.getDetailBoard(res.data);
    });
  }, []);
  return (
    <>
      hello
      <input value={props.detailBoard.id} />
      아이디{props.detailBoard.id}
      이름{props.detailBoard.name}
      타이틀{props.detailBoard.title}
      {props.detailBoard.skill_stack}
      {props.detailBoard.work_field}
      {props.detailBoard.max_people}
      {props.detailBoard.end_date}
      {props.detailBoard.content}
      {props.detailBoard.create_date}
    </>
  );
}

export default DetailPage;
